import React from 'react';
import 'tailwindcss/tailwind.css';
import { useNavigate } from 'react-router-dom';
side

const Admin = () => {
    const navigate = useNavigate();

    const handleManageUsers = () => {
        navigate('/manage-users');
    };

    const handleManageFoods = () => {
        navigate('/manage-foods');
    };

    const handleManageTables = () => {
        navigate('/manage-tables');
    };

    return (
        <div className="flex-grow p-8 bg-white shadow-lg rounded-lg mx-6 mt-4 mb-4">
            <h1 className="text-4xl font-semibold text-pastelDarkRed mb-10 text-center">Admin Dashboard</h1>
            <div className="flex flex-col space-y-4">
                <button
                    onClick={handleManageUsers}
                    className="bg-pastelRose text-white rounded-lg px-4 py-2 hover:bg-pastelLightPink transition duration-300"
                >
                    Manage Users
                </button>
                <button
                    onClick={handleManageFoods}
                    className="bg-pastelRose text-white rounded-lg px-4 py-2 hover:bg-pastelLightPink transition duration-300"
                >
                    Manage Foods & Drinks
                </button>
                <button
                    onClick={handleManageTables}
                    className="bg-pastelRose text-white rounded-lg px-4 py-2 hover:bg-pastelLightPink transition duration-300"
                >
                    Manage Tables
                </button>
            </div>
        </div>
    );
};

export default Admin;
